const Clk=()=>{
   
  {i++}
  console.log("clicked");
   }


ReactDOM.render(
  <>
  <div className="styl">
  <h1>{i}</h1>
  <button onClick={Clk} >click me</button>
  
  </div>
  </>
  ,document.getElementById("root"));
